\section{Recomputing a Minimum Spanning Tree}
\subsection*{Case 1: \texorpdfstring{$e \notin E'$}{e not in E} {\normalfont and} \texorpdfstring{$\hat{w}(e) > w(e)$}{w'(e) > w(e)} }
Since the edge is not part of the MST and the weight is now greater than it was before, it is certainly not part of the MST. This is a simple assignment and can be done in constant time i.e. $\mathcal{O}(1)$. 

\subsection*{Case 2: \texorpdfstring{$e \notin E'$}{e not in E} {\normalfont and} \texorpdfstring{$\hat{w}(e) < w(e)$}{w'(e) < w(e)} }
Since the weight of the edge is decreasing, it might now be part of the MST.
To determine this, we cut the MST at the edge $e$ into two parts $C = (A, B)$.
We do this by starting at the vertices of $e$ and in a breadth first manner traverse outwards and label each node `blue' or `red' if they belong to $A$ or $B$ respectively. Since we traverse each node only once, this is in $\mathcal{O}(|V|)$ time. However, in an MST $|V| = |E'| - 1$ and we can write it as $\mathcal{O}(|E'|)$

Then we find the cut-set in $G$, i.e. the set of edges with one vertice in A and one in B. In mathematical notation: $S = \{(u,v) \in E \mid u \in A, v \in B\}$ This is done by finding all edges $e = (u, v) \in E$ where $u.\mathrm{color} \neq v.\mathrm{color}$. Checking the color of a node is done in constant time while travsersing all edges is done in $\mathcal{O}(|E|)$ time. 

In order to maintain the minimum property of the MST we must select the lightest edge $e \in S$ as the connecting edge from $A$ and $B$ in the MST $T$. (This is given by Theorem 23.1 in the course literature.)

Overall, we have the complexity $\mathcal{O}(|E| + |E'|)$ where $E' \subset E$ and thus we get $\mathcal{O}(|E|)$.


\subsection*{Case 3: \texorpdfstring{$e \in E'$}{e in E} {\normalfont and} \texorpdfstring{$\hat{w}(e) < w(e)$}{w'(e) < w(e)} }
This is similar to Case 1, except that the edge is already in the MST. Since its weight is now less than before, it must remain in the MST. Thus: $\mathcal{O}(1)$.

\subsection*{Case 4: \texorpdfstring{$e \in E'$}{e in E} {\normalfont and} \texorpdfstring{$\hat{w}(e) > w(e)$}{w'(e) > w(e)} }
Just like in Case 2, we now have the situation that another edge might be lighter. So we must yet again look at the cut-set and select the edge with the smallest weight $w(e)$.

